import React from "react";


function Nav() {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <a className="navbar-brand" href="/">
        CLICKY GAME
      </a>
      <span class="navbar-text">
      Navbar text with an inline element
    </span>
    </nav>
  );
}

export default Nav;
